import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function StudProfile() {
  const [student, setStudent] = useState(null);
  const [leaves, setLeaves] = useState([]);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchStudent = async () => {
      const token = localStorage.getItem("token");

      if (!token) {
        setError("Unauthorized: No token found");
        navigate("/login");
        return;
      }

      try {
        const response = await axios.get("http://localhost:5000/api/studprofile", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        setStudent(response.data.Stud);
        setLeaves(response.data.Stud.leaves || []);
      } catch (err) {
        console.error("Error fetching student profile:", err.response ? err.response.data : err);
        setError(err.response?.data?.error || "An error occurred");
      }
    };

    fetchStudent();
  }, [navigate]);

  return (
    <div className="container mt-4">
      <h1 className="text-center">Student Details</h1>
      <div className="card mb-4 shadow-sm">
        {error && <div className="alert alert-danger text-center">{error}</div>}

        {student ? (
          <div className="row no-gutters">
            <div className="col-md-6">
              <img
                src={`http://localhost:5000/Images/${student.ProfileImage}`}
                alt={`${student.name}'s profile`}
                className="img-fluid"
              />
            </div>
            <div className="col-md-6 p-3">
              <p>
                <strong>Name:</strong> {student.name}
              </p>
              <p>
                <strong>Department:</strong> {student.dept}
              </p>
              <p>
                <strong>Year:</strong> {student.year}
              </p>
              <p>
                <strong>Section:</strong> {student.sec}
              </p>
              <p>
                <strong>Email:</strong> {student.email}
              </p>
              <p>
                <strong>Roll No:</strong> {student.rollno}
              </p>
              <p>
                <strong>Room No:</strong> {student.roomno}
              </p>
              <p>
                <strong>Warden Name:</strong> {student.wardenname}
              </p>
            </div>
          </div>
        ) : (
          <div className="text-center">Loading...</div>
        )}
      </div>
      <div className="table-responsive">
        <table className="table table-striped table-hover">
          <thead className="thead-light">
            <tr>
              <th>SNo</th>
              <th>Leave Type</th>
              <th>From Date</th>
              <th>To Date</th>
              <th>Applied Date</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {leaves.map((leave, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{leave.leavetype}</td>
                <td>{leave.from}</td>
                <td>{leave.to}</td>
                <td>{leave.appliedDate}</td>
                <td>{leave.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default StudProfile;
